					'&lt;p&gt;Lash Color is an eyebrow and eyelash dye by Levissime! Using Lash Colour you will get a glossy and natural look. The dye adds intensity to your look by enhancing your eyebrows and lashes without the use of mascara. Lash Color LEVISSIME is a carefully designed professional cosmetics with the delicate and sensitive skin and eye area in mind.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The dye is easy and safe to use. Its active ingredients maximize the intensity and fixation of the color, protecting, moisturizing and nurturing eyebrows and eyelashes. The gel-like consistency blends very well with the dedicated Lash Activator 1.8% concentration of oxidized water.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The dye penetrates beautifully into the hair, and subsequent coloring does not darken the color, but beautifully layers the color which makes the color last up to 6 weeks in the hair.The results are precise and professional.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To make the coloring permanent and in the right color, it is best to use a dedicated oxidizer LeviSsime Lash Activator.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;u&gt;&lt;b&gt;APPLICATION&lt;/b&gt;&lt;/u&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;1) Remove makeup from around the eyes.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;2. Prepare the mixture in a plastic or glass bowl. Mix LeviSsime Lash Color dye with LeviSsime Lash Activator or hydrogen peroxide water in an equal ratio of 1 to 1 until smooth and creamy.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;3. Use a brush to coat eyebrows and lashes with the mixture. Leave it on for 15 minutes.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;4.After this time, remove the product with a cotton ball moistened with water.&lt;/p&gt;',
